    return (
        <div id="timeline">
        <Timeline>
          <Events>
          {this.props.data ? this.props.data.map(d =>
            <ImageEvent
            date={d ?d.date : 'loading'}
            text={d ?d.text : 'loading'}
            src={d ?d.src : 'loading'}
            credit={d ?d.textBelow : 'loading'}
            />
          ): 'loading'}
           </Events>
         </Timeline>
   </div>
